import React from 'react';
import Grid from '../components/Grid';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import FadeIn from 'react-fade-in';
import { shake } from 'react-animations';
import styled, { keyframes } from 'styled-components';
import homeimage from '../assets/HomeImage.png';

// Animation code derived from: https://www.npmjs.com/package/react-animations
const myAnimation = keyframes`${shake}`;
const Animation = styled.div`
  animation: 1s ${myAnimation};
`;

function HomePage(props) {
    const width = 9;
    window.scrollTo(0, 0);
    return (
        <FadeIn delay={400} className="background">
            <Jumbotron className="bg-transparent jumbotron-fluid hero">
                <Container fluid={true}>
                    <Row className="justify-content-center py-5">
                    <div class="left" data-aos="fade-right">
                        <img
                            class="profile-image"
                            alt="Profile"
                            src={aboutpic}
                        />
                    </div>
                    <div class="right">
                        <p className="about-subtitle">
                            Hi there! I'm Bryan Ge.
                        </p>

                        <p>
                            I‚Äôm currently a freshman at the University of Illinois at Urbana-Champaign majoring in <a className="link-underline" target="_blank" rel="noreferrer" href="https://cs.illinois.edu/academics/undergraduate/degree-program-options/bs-statistics-computer-science">Statistics and Computer Science</a> and minoring in Business and Informatics. I am heavily involved in the design community on campus, especially through <a className="link-underline" target="_blank" rel="noreferrer" href="https://www.designinnovationillinois.com/">Design Innovation</a> and <a className="link-underline" target="_blank" rel="noreferrer" href="http://wcs.illinois.edu/">Women in Computer Science</a> student organizations.
                        </p>

                        <p className="about-subtitle">
                            What am I up to right now?
                        </p>

                        <p>
                            I am an Operations Strategist on the <a className="link-underline" target="_blank" rel="noreferrer" href="https://hack4impact.org/">National Hack4Impact</a> board working on improving the way Hack4Impact runs at its 14 chapters across the nation. Currently, I am revamping the syllabus to increase the level of organization, communication, and engagement within chapters. I am also developing workshops for our Hack4Impact Alumni Mentorship Program. These events include  career growth, social responsibility, and mental health.
                        </p>

                        <p>
                            I am interning at <a className="link-underline" target="_blank" rel="noreferrer" href="https://cargill.com/">Cargill</a> as a UX/UI Designer this summer! More details to come. :)
                        </p>

                        <p className="about-subtitle">
                            Outside of work, I enjoy...
                        </p>

                        <p>
                            üéûÔ∏è watching thrillers with friends
                            <br />üíÑ getting glam and going on photoshoots
                            <br />üë®‚Äçüç≥ baking blueberry crumble and cranberry brie tarts
                            <br />üê∂ spending time with my sister and her corgi (Denzel Corgiton)
                        </p>

                        <p>
                            I'm always down to chat! Email me at <a className="link-underline" href="mailto:bryanjg2@illinois.edu">bryanjg2@illinois.edu</a> and connect with me on <a className="link-underline" href="https://linkedin.com/in/bryange">LinkedIn</a>.
                        </p>
                    </div>
                        <img src={homeimage} className="home-image" alt="Figma Cursor" />
                        <Col md={width - 4} sm={12}>
                            {/* {props.animated && <h2 className="display-4"><Animation>{props.animated}</Animation></h2>} */}
                            {props.title && <h2 className="display-5 font-weight-bolder home-title">{props.title}</h2>}
                            {/* {props.subTitle && <h2 className="display-5 font-weight-normal">{props.subTitle}</h2>} */}
                            <div className="home-positions">
                                <h3 className="font-weight-normal role">UX/UI Design Intern at <a className="link-underline" href="https://www.cargill.com/" target="_blank" rel="noreferrer">Cargill</a></h3>

                                <h3 className="font-weight-normal role">National Operations Strategist at <a className="link-underline" href="https://hack4impact.org/" target="_blank" rel="noreferrer">Hack4Impact</a></h3>

                                <h3 className="font-weight-normal role">Student at UIUC studying <a className="link-underline" href="https://cs.illinois.edu/academics/undergraduate/degree-program-options/bs-statistics-computer-science" target="_blank" rel="noreferrer">CS + Statistics</a></h3>
                            </div>
                        </Col>
                    </Row>
                </Container>
            </Jumbotron>

            <Grid projects={props.projects} />
        </FadeIn >
    );
}

export default HomePage;
